import React from 'react'
import Button from "../Button/Button"
import styles from "./Navbar.module.css"
import Logo from '../Logo/logo'

export const Navbar = () => {
  return (
    <nav className="">
      <Logo/>
      <Button child="Give Feedback"/>
    </nav>
  )
}
